	public function send_flood($url, $hits)
	{
		
		for($i = 0; $i < $hits; $i++)
		{
			$ref = $this->gen_ref();
			$agent = $this->gen_agent();
			
			$ch = curl_init($url);
			curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
			curl_setopt($ch, CURLOPT_REFERER, $ref);
			curl_setopt($ch, CURLOPT_USERAGENT, $agent);
			curl_setopt($ch, CURLOPT_TIMEOUT, 86400);
			curl_exec($ch);
			
			echo "Sucessfully send hits to $url from refferer site: $ref \n";
		}
		
	}
	
